    (array) => 
    <div key = {array.id} className="element">
        <div className="image">
            {array.image}
        </div>

        <div className="title">
            <h1>{array.title}</h1>
        </div>

        <div className="text">
            <p>{array.text}</p>
        </div>
    </div>
)

function Array(){
    return(
        {ArrayMaps}
    )
}

